import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { Button } from "@/components/ui/button";

const packages = [
  { name: "Manali–Shimla Family Tour", days: "5N/6D", path: "/package/manali-shimla" },
  { name: "Rishikesh Camping + Rafting", days: "2N/3D", path: "/package/rishikesh" },
  { name: "Golden Triangle Tour", days: "4N/5D", path: "/package/golden-triangle" },
  { name: "Thailand Group Tour", days: "5N/6D", path: "/package/thailand" },
  { name: "Char Dham Yatra", days: "10N/11D", path: "/package/char-dham" },
];

const Home = () => (
  <div className="p-6 text-center">
    <h1 className="text-4xl font-bold mb-4">TNT – Travel. Nature. Thrill.</h1>
    <p className="mb-6">Explore our top-rated tours and unforgettable experiences.</p>
    <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
      {packages.map((pkg) => (
        <div className="border p-4 rounded-2xl shadow-md" key={pkg.name}>
          <h2 className="text-xl font-semibold mb-2">{pkg.name}</h2>
          <p className="mb-2">Duration: {pkg.days}</p>
          <Link to={pkg.path}>
            <Button>View Package</Button>
          </Link>
        </div>
      ))}
    </div>
  </div>
);

const Contact = () => (
  <div className="p-6 max-w-xl mx-auto">
    <h2 className="text-2xl font-bold mb-4">Contact Us</h2>
    <p className="mb-2">Email: tntandcompanies@gmail.com</p>
    <p className="mb-2">Phone: (Coming Soon)</p>
  </div>
);

const PackageDetail = ({ name, days }) => (
  <div className="p-6 max-w-3xl mx-auto">
    <h2 className="text-3xl font-bold mb-4">{name}</h2>
    <p className="mb-4">Duration: {days}</p>
    <p className="mb-4">[Package itinerary and highlights go here]</p>
    <Link to="/book">
      <Button>Book Now</Button>
    </Link>
  </div>
);

const Booking = () => (
  <div className="p-6 max-w-xl mx-auto">
    <h2 className="text-2xl font-bold mb-4">Booking & Payment</h2>
    <form className="space-y-4">
      <input type="text" placeholder="Full Name" className="w-full p-2 border rounded" required />
      <input type="email" placeholder="Email" className="w-full p-2 border rounded" required />
      <input type="tel" placeholder="Phone Number" className="w-full p-2 border rounded" required />
      <Button type="button" onClick={() => alert('Redirecting to Razorpay...')}>Pay with Razorpay</Button>
    </form>
  </div>
);

export default function App() {
  return (
    <Router>
      <nav className="bg-gray-800 text-white p-4 flex justify-between">
        <Link to="/" className="font-bold">TNT Tours</Link>
        <div className="space-x-4">
          <Link to="/">Home</Link>
          <Link to="/contact">Contact</Link>
        </div>
      </nav>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/book" element={<Booking />} />
        {packages.map(pkg => (
          <Route key={pkg.path} path={pkg.path} element={<PackageDetail name={pkg.name} days={pkg.days} />} />
        ))}
      </Routes>
    </Router>
  );
}
